import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate, useLocation } from 'react-router-dom';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import VisionMission from './components/VisionMission';
import Features from './components/Features';
import Testimonials from './components/Testimonials';
import Gallery from './components/Gallery';
import BookingForm from './components/BookingForm';
import Footer from './components/Footer';
import LoginRegister from './components/LoginRegister';
import Matches from './components/Matches';

const initialMatches = [
  {
    id: 1,
    date: '2024-06-10',
    time: '6:00 PM',
    location: 'Andheri West Turf',
    playersLeft: 22,
  },
  {
    id: 2,
    date: '2024-06-11',
    time: '7:00 PM',
    location: 'Bandra East Elite Turf',
    playersLeft: 22,
  },
  {
    id: 3,
    date: '2024-06-12',
    time: '8:00 PM',
    location: 'Powai Pro Turf',
    playersLeft: 22,
  },
  {
    id: 4,
    date: '2024-06-13',
    time: '6:30 PM',
    location: 'Juhu Champion Turf',
    playersLeft: 22,
  },
  {
    id: 5,
    date: '2024-06-14',
    time: '7:30 PM',
    location: 'Andheri West Turf',
    playersLeft: 22,
  },
];

const initialTestimonials = [
  { name: 'Rahul Sharma', text: 'Kickora made it so easy to play football again! No more worrying about finding teammates or equipment. Just book and play!', rating: 5 },
  { name: 'Priya Patel', text: 'The quality of turfs and equipment is outstanding. It feels like playing in a professional setup every time!', rating: 5 },
  { name: 'Arjun Singh', text: 'Perfect solution for someone who moved to a new city. Made friends through football and got back into shape!', rating: 5 },
  { name: 'Meera Kapoor', text: 'Amazing experience! The booking process is seamless and the matches are always well-organized.', rating: 5 },
  { name: 'Vikram Malhotra', text: 'Great for team building! We book regular slots for our office team and everyone loves it.', rating: 5 },
  { name: 'Anjali Desai', text: 'Affordable and convenient. Perfect for students who want to stay active without breaking the bank.', rating: 5 },
];

const AppRoutes = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [pendingMatch, setPendingMatch] = useState(null);
  const [matches, setMatches] = useState(initialMatches);
  const [testimonials, setTestimonials] = useState(initialTestimonials);
  const navigate = useNavigate();

  const handleBook = (match) => {
    if (!isLoggedIn) {
      setPendingMatch(match);
      navigate('/login');
    } else {
      // Decrement playersLeft for the booked match
      setMatches((prevMatches) =>
        prevMatches.map((m) =>
          m.id === match.id && m.playersLeft > 0
            ? { ...m, playersLeft: m.playersLeft - 1 }
            : m
        )
      );
      alert(`Booking confirmed for 11-a-side at ${match.location} on ${match.date} at ${match.time}`);
    }
  };

  const handleLogin = () => {
    setIsLoggedIn(true);
    if (pendingMatch) {
      setMatches((prevMatches) =>
        prevMatches.map((m) =>
          m.id === pendingMatch.id && m.playersLeft > 0
            ? { ...m, playersLeft: m.playersLeft - 1 }
            : m
        )
      );
      alert(`Booking confirmed for 11-a-side at ${pendingMatch.location} on ${pendingMatch.date} at ${pendingMatch.time}`);
      setPendingMatch(null);
      navigate('/matches');
    } else {
      navigate('/');
    }
  };

  const handleTestimonialSubmit = (testimonial) => {
    setTestimonials((prev) => [testimonial, ...prev]);
  };

  return (
    <>
      <Navbar isMenuOpen={false} setIsMenuOpen={() => {}} />
      <Routes>
        <Route
          path="/"
          element={
            <div className="App">
              <Hero />
              <VisionMission />
              <Features />
              <Testimonials testimonials={testimonials} onSubmit={handleTestimonialSubmit} isLoggedIn={isLoggedIn} />
              <Gallery />
              <BookingForm />
              <Footer />
            </div>
          }
        />
        <Route path="/login" element={<LoginRegister onLogin={handleLogin} />} />
        <Route path="/matches" element={<Matches matches={matches} onBook={handleBook} />} />
      </Routes>
    </>
  );
};

function App() {
  return (
    <Router>
      <AppRoutes />
    </Router>
  );
}

export default App;
